// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PetAdoption {
    address public owner;

    struct Pet {
        string petName;
        string breed;
        uint256 age;
        address adopter;
        uint256 adoptionStartTime;
    }

    struct AdoptionHistory {
        uint256 petId;
        uint256 adoptionStartTime;
        uint256 adoptionEndTime;
        uint256 adoptionFee;
    }

    mapping(uint256 => Pet) public pets;
    mapping(address => AdoptionHistory[]) public adoptionHistory;
    uint256 public totalPets;
    uint256 public adoptionFeeRate; // Fee in wei per hour

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier onlyAdopter(uint256 petId) {
        require(msg.sender == pets[petId].adopter, "Only adopter can call this function");
        _;
    }

    modifier validPetId(uint256 petId) {
        require(petId < totalPets, "Invalid pet ID");
        _;
    }

    event PetAdopted(uint256 petId, address adopter, uint256 adoptionStartTime);
    event PetReturned(
        uint256 petId,
        address adopter,
        uint256 adoptionEndTime,
        uint256 adoptionDuration,
        uint256 adoptionFee
    );

    event AdoptionFeeRateSet(uint256 newRate);

    constructor() {
        owner = msg.sender;
        adoptionFeeRate = 0.01 ether; // Adoption fee rate per hour
    }

    function setAdoptionFeeRate(uint256 newRate) external onlyOwner {
        adoptionFeeRate = newRate;
        emit AdoptionFeeRateSet(newRate);
    }

    function addPet(string memory _petName, string memory _breed, uint256 _age) external onlyOwner {
        uint256 petId = totalPets++;
        pets[petId] = Pet({
            petName: _petName,
            breed: _breed,
            age: _age,
            adopter: address(0),
            adoptionStartTime: 0
        });
    }

    function deletePet(uint256 petId) external onlyOwner {
        require(pets[petId].adopter == address(0), "Cannot delete an adopted pet");
        delete pets[petId];
        totalPets--;
    }

    function adoptPet(uint256 petId) external payable validPetId(petId) {
        require(pets[petId].adopter == address(0), "Pet is already adopted");
        require(msg.value >= adoptionFeeRate, "Insufficient fee for adoption");

        pets[petId].adopter = msg.sender;
        pets[petId].adoptionStartTime = block.timestamp;

        emit PetAdopted(petId, msg.sender, block.timestamp);
    }

    function returnPet(uint256 petId) external onlyAdopter(petId) validPetId(petId) {
        require(pets[petId].adopter != address(0), "Pet is not adopted");

        uint256 adoptionEndTime = block.timestamp;
        uint256 adoptionDuration = adoptionEndTime - pets[petId].adoptionStartTime;
        uint256 adoptionFee = calculateAdoptionFee(adoptionDuration);

        emit PetReturned(petId, msg.sender, adoptionEndTime, adoptionDuration, adoptionFee);

        adoptionHistory[msg.sender].push(AdoptionHistory(petId, pets[petId].adoptionStartTime, adoptionEndTime, adoptionFee));

        payable(owner).transfer(adoptionFee);

        delete pets[petId];
    }

    function calculateAdoptionFee(uint256 adoptionDuration) internal view returns (uint256) {
        return adoptionDuration * adoptionFeeRate;
    }

    function getPetDetails(uint256 petId) external view returns (string memory petName, string memory breed, uint256 age, address adopter, uint256 adoptionStartTime) {
        Pet storage pet = pets[petId];
        return (pet.petName, pet.breed, pet.age, pet.adopter, pet.adoptionStartTime);
    }

    function getAdoptionHistory() external view returns (AdoptionHistory[] memory) {
        return adoptionHistory[msg.sender];
    }

    function getAvailablePets() external view returns (uint256[] memory availablePetIds) {
        uint256 count = 0;

        for (uint256 i = 0; i < totalPets; i++) {
            if (pets[i].adopter == address(0)) {
                count++;
            }
        }

        availablePetIds = new uint256[](count);
        count = 0;

        for (uint256 i = 0; i < totalPets; i++) {
            if (pets[i].adopter == address(0)) {
                availablePetIds[count] = i;
                count++;
            }
        }

        return availablePetIds;
    }
}

